import React from "react";
import PlanetComponent from "../page/PlanetComponent";
import './Planet.css'
import mercury from '../assets/sound/mercury.mp3'
import {Mercury} from '../assets/sound/mercury.jpeg'

const Planet = () => {
  return (
    <section id="planet">
      <div className="planets-gallery">
        <PlanetComponent
          name="Mercury"
          imageSrc="mercury.jpg"
          radiationLevel="Moderate"
          soundSrc="mercury"
        />
      </div>
    </section>
  );
};

export default Planet;
